import React from 'react';
import { BrowserRouter as Router, Link } from 'react-router-dom'; // Link 컴포넌트 import 추가
import './App.css';
import Kakao from './component/Kakao';
import SearchBarIcon from '../component/searchbar.svg';
import FavoritelocIcon from '../component/favoriteloc.svg';

function App() {
  return (
    <Router>
      <div className='App'>
        <Kakao />
        <div className="header">
          <nav>
            <ul>
              <li>
                <Link to="/Searchbar"> {/* Link 컴포넌트 사용 */}
                  <img src={SearchBarIcon} alt="SearchBar" />
                </Link>
              </li>
              <li>
                <Link to="/favoriteloc"> {/* Link 컴포넌트 사용 */}
                  <img src={FavoritelocIcon} alt="Favoriteloc" />
                </Link>
              </li>
            </ul>
          </nav>
        </div>
      </div>
    </Router>
  );
}

export default App;
